import React, { Component }  from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
class List extends Component {
  render() {
    return(

      <section class="" id="">
      <div class="container">
          <div class="text-center">
              <h2 class="section-heading text-uppercase">List</h2>
          </div>

      </div>
  </section>


    );
  }
}
export default List;
